import React from 'react';

const Image = (props) => {
    console.log(props.isSmile);
    return(
        <>
            <div className="img">
                {(() => {
                    if (props.count === 41) {
                        return <span>オモロー</span>
                    } else if(props.isSmile === true) {
                        return <p>アホ</p>
                    }else{
                        return <p>普通</p>
                    }
                })()}
            </div> 
        </>
    )
};
export default Image;
